import React, { useEffect, useState } from 'react'

const NotesPage = () => {
  let [notes, setNotes] = useState([])

  useEffect(() => {
    getNotes()
  }, [])

  let getNotes = async () => {
    let response = await fetch('http://127.0.0.1:8000/api/notes/')
    let data = await response.json()
    console.log(data)
    setNotes(data)
  }

  return (
    <div>NotesPage</div>
  )
}

export default NotesPage
